import java.util.List;
import java.util.ArrayList;
import java.util.Map;
import java.util.HashMap;

class Solution2 {
    public List<Integer> findAnagrams(String s, String p) {
        // Try to use sliding window technique
        // if p.length is len, we can have len different starting point
        // every stride is len as well
        // so in the end Complexity is sLen/len*len, O(sLen) time
        // Actually O(sLen) * checktime
        Map<Character, Integer> pcMap = new HashMap<>();
        for(char c: p.toCharArray()){
            pcMap.put(c, pcMap.getOrDefault(c, 0) + 1);
        }
        List<Integer> res = new ArrayList<>();
        int len = p.length(), sLen = s.length(), window = 0, lenCount = 0, winLen = pcMap.size();
        Map<Character, Integer> countMap = new HashMap<>();
        for(int i = 0; i < sLen; i++){
            lenCount++;
            if(i == 10035){
                System.out.println("10035");
            }
            char c = s.charAt(i);
            if(!pcMap.containsKey(c)){
                countMap.clear();
                lenCount = 0;
                window = 0;
                continue;
            }
            if(lenCount > len){
                char hc = s.charAt(i-len);
                int curC = countMap.get(hc);
                int purC = pcMap.get(hc);
                if(curC == purC) --window;
                else if(curC == purC + 1) ++window;
                countMap.put(hc, countMap.get(hc)-1);
                lenCount--;
            }
            int count = countMap.getOrDefault(c, 0) + 1;
            countMap.put(c,count);
            if(count == pcMap.get(c)) window ++;
            else if(count == 1 + pcMap.get(c)) window--; 
            if(window == winLen) res.add(i-len+1);
        }
        return res;
    }

    public static void main(String[] Args){
        Solution2 slt = new Solution2();
        String s = "";
        String p = "";
        System.out.println(slt.findAnagrams(s,p).toString());
    }
}